import './App.css';
import Menuw from './components/Menuw';
import CarroPerfil from './components/CarroPerfil';
import Galeria from './components/Galeria';
import ProductoDetalle from './components/ProductoDetalle';
import GaleriaFlotante from './components/GaleriaFlotante';
import Fot from './components/Fot';
import {useState} from "react";

function App() {
  const [cantidad, setCantidad] = useState(0);
  const [total, setTotal] = useState(0);

  return (
    <div>
    <GaleriaFlotante></GaleriaFlotante>
    <div className="contenedor">

      <div className='fila1'> 
        <Menuw></Menuw>
        <CarroPerfil  cantidad={cantidad} setCantidad={setCantidad}></CarroPerfil>
      </div>

      <div className='fila2'>
        <div className='fila2_izq'>
          <Galeria></Galeria>

        </div>

        <div className='fila2_der'>
          <ProductoDetalle cantidad={total} setCantidad={setTotal}></ProductoDetalle>
        </div>
      </div>

    </div>
    <Fot></Fot>
    </div>
  );
}

export default App;
